import Fetch from 'isomorphic-unfetch';
import React from 'react';
import ReactTable from 'react-table';
// import 'react-table/react-table.css';

const Root = ({ products }) => {
  const columns = [
    {
      Header: 'ID',
      accessor: 'id',
    },
    {
      Header: 'Service',
      accessor: 'service',
    },
    {
      Header: 'Producer',
      accessor: 'producer',
    },
    {
      Header: 'Name',
      accessor: 'name',
    },
    {
      Header: 'EAN',
      accessor: 'ean',
    },
    {
      Header: 'Price',
      accessor: 'price',
    },
    {
      Header: 'CeneoPrice',
      accessor: 'ceneoPrice',
    },
  ];

  return (
    <div>
      <ReactTable columns={columns} data={products}></ReactTable>
    </div>
  );
};

Root.getInitialProps = async () => {
  const res = await Fetch('http://localhost:1000');
  const jsonData = await res.json();

  console.log(jsonData);

  return {
    products: jsonData,
  };
};

export default Root;
